<!DOCTYPE html>
<html lang="es">
<head>
    <meta http-equiv="Content-Type" content="text/html; charset=gb18030">
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>Banco TIC</title>
    <!-- Bootstrap -->
    <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css" integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T" crossorigin="anonymous">
    <!-- own style -->
    <link rel="stylesheet" type="text/css" href="style.css">
    <!-- font awesome -->
    <link rel="stylesheet" href="https://use.fontawesome.com/releases/v5.8.2/css/all.css" integrity="sha384-oS3vJWv+0UjzBfQzYUhtDYW+Pj2yciDJxpsK1OYPAYjqT085Qq/1cq5FLXAZQ7Ay" crossorigin="anonymous">
</head>
<body>
    <div>
        <!-- menu -->
        <div class="container-fluid">
            <div class="menu">
                <div class="logo"><h1>Banco TIC</h1></div>
                <ul class="nav nav-tabs justify-content-flex-end">
                    <li class="nav-item">
                        <a class="nav-link" href="#"><i class="fas fa-folder-open fa-3x"></i></a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link" href="#"><i class="fas fa-user fa-3x"></i></a>
                    </li>
                </ul>
            </div>
        </div>
        <!-- menu -->
        <!-- banner -->
        <div class="container-banner">
          <img src="img/index.png" class="img-fluid" alt="Responsive image"> 
          <div class="banner">
            <p class="description">
            Banco TIC, es un sistema innovador de información para la gestión del Banco de Proyectos de tecnologías de la información y las comunicaciones (TIC).
            </p>
          </div> 
        </div>
        <!-- banner -->
        <!-- entities -->
        <div class="container-entities">
            <div class="card-deck">
                <div class="card text-center">
                    <button type="button" class="btn btn-entity"><img src="img/capital.svg" class="card-img-top" alt="" width="80%" height="80%"></button>
                    <div class="card-body">
                        <h5 class="card-title">ESTADO</h5>
                        <p class="card-text text-justify">
                            Encontrarás los proyecto en que el estado gubernamental estuvo, está y estará realizando en el entorno TIC.
                        </p>
                    </div>
                </div>
                <div class="card text-center">
                    <button type="button" class="btn btn-entity"><img src="img/knowledge.svg" class="card-img-top" alt="" width="80%" height="80%"></button>
                    <div class="card-body">
                        <h5 class="card-title">UNIVERSIDAD</h5>
                        <p class="card-text text-justify">
                            Encontrarás los proyecto en que las universidades estuvieron, están y estarán realizando en el entorno TIC.
                        </p>
                    </div>
                </div>
                <div class="card text-center">
                    <button type="button" class="btn btn-entity"><img src="img/home.svg" class="card-img-top" alt="" width="80%" height="80%"></button>
                    <div class="card-body">
                        <h5 class="card-title">EMPRESA</h5>
                        <p class="card-text text-justify">    
                            Encontrarás los proyecto en que las empresas estuvieron, están y estarán realizando en el entorno TIC
                        </p>
                    </div>
                </div>
            </div>
        </div>
        <!-- entities -->
        <!-- allied companies -->
        <div class="container-allies">
            <img src="https://upload.wikimedia.org/wikipedia/commons/5/57/LogoUAN.png" alt="..." class="img-thumbnail">
            <img src="http://gisoft.co/sites/default/files/parque-200.png" alt="" class="img-thumbnail">
            <img src="https://ceo.uniandes.edu.co/images/Unillanos.png" alt="" class="img-thumbnail">
            <img src="http://www.ccv.org.co/site/fileadmin/introduction/images/theme/CCV.png" alt="..." class="img-thumbnail">
            <img src="https://inandina.edu.co/2.0/wp-content/themes/g5_hydrogen/custom/images/logoweb.png" alt="..." class="img-thumbnail">
            <img src="http://www.unimeta.edu.co/images/backgrounds/UNIMETA_red_outline_logo_200x200.png" alt="..." class="img-thumbnail">
            <img src="http://www.expodefensa.com.co/wp-content/uploads/2017/08/logo-codaltec1-2.png" alt="..." class="img-thumbnail">
            <img src="data:image/png;base64," alt="..." class="img-thumbnail">
            <img src="http://mobilecorp.co/img/logo.png" alt="..." class="img-thumbnail">
            <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/45/U._Cooperativa_de_Colombia_logo.svg/1200px-U._Cooperativa_de_Colombia_logo.svg.png" alt="..." class="img-thumbnail">
            <img src="http://noticiasdeacacias.com/wp-content/uploads/2018/11/117-2-2.png" alt="..." class="img-thumbnail">
            <img src="https://www.epicos.com/sites/default/files//styles/ogimage_thumb/public/tuxstone_logo.png?itok=iBnh12qk" alt="..." class="img-thumbnail">
            <!-- <img src="..." alt="..." class="img-thumbnail"> -->
        </div>
        <!-- allied companies -->
        <!-- footer -->
        <div class="card-own text-white">
            <div class="card-body-footer">
                <div>
                    <p class="card-text-justify"><strong class="subheading">Get connected with us on social networks!</strong></p>
                </div>
                <div class="icon-social">
                    <i class="fab fa-facebook-square fa-2x"></i> &emsp;
                    <i class="fab fa-twitter-square fa-2x"></i> &emsp;
                    <i class="fab fa-instagram fa-2x"></i> &emsp;
                    <i class="fab fa-google-plus fa-2x"></i> 
                </div>
                <!-- <img src="https://image.flaticon.com/icons/svg/69/69407.svg" class="icon-social">
                <img src="https://image.flaticon.com/icons/svg/1384/1384015.svg" class="icon-social">
                <img src="https://image.flaticon.com/icons/svg/121/121518.svg" class="icon-social"> -->
            </div>
            <div class="card-footer text-muted">
            &copy;2019 — <strong class="subheading">Banco TIC</strong>
            </div>
        </div>
        <!-- footer -->
    </div>
    <script src="https://code.jquery.com/jquery-3.3.1.slim.min.js" integrity="sha384-q8i/X+965DzO0rT7abK41JStQIAqVgRVzpbzo5smXKp4YfRvH+8abtTE1Pi6jizo" crossorigin="anonymous"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.14.7/umd/popper.min.js" integrity="sha384-UO2eT0CpHqdSJQ6hJty5KVphtPhzWj9WO1clHTMGa3JDZwrnQq4sF86dIHNDz0W1" crossorigin="anonymous"></script>
    <script src="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/js/bootstrap.min.js" integrity="sha384-JjSmVgyd0p3pXB1rRibZUAYoIIy6OrQ6VrjIEaFf/nJGzIxFDsf4x0xIM+B07jRM" crossorigin="anonymous"></script>
</body>
</html>